import React, { Component } from 'react';

export default class LeftOptionsNav extends Component {
    constructor(props) {
        super(props);
        this.state = {
            visible : false
        }
    }

    openModal() {
        this.setState({
            visible : true
        });
    }

    closeModal() {
        this.setState({
            visible : false,
        });
    }

    render() {
        return (
            <ul className="left_options">
                <li className="left_option show_shape">shape</li> 
                <li className="left_option show_face">face</li>
                <li className="left_option show_hair">hair</li>
                <li className="left_option show_accessories">accessories</li>
            </ul>
        );
    }
};










